let content = null;
console.log('temp', {temp})
if(temp>20){
    content = (
        <div> 
            <img src={img_src.sun} alt="sun" width="128" height="128"/>
        </div>
    )

}

else if (err) {
    content = (
        <div> 
        </div>
    )

}



return (
        <div className="Visual">
            {err ? `picture not available` 
            :content}
        </div>


  );
}

export default Visual;
